import React, { useRef } from 'react'
import './NavBar.css'
import { Link } from "react-router-dom";
import { HashLink } from 'react-router-hash-link';




export const NavBar = ({About}) => {
    // const moveDown = () =>{
    //     About.current.scrollIntoView({behavior:'smooth' , block:'start'})
    // }

    return (
        <div className=' nav-container nav'>
            <div className='left-nav'>
                <Link to='/'>DevFolio</Link>
            </div>
            <div className='right-nav'>
                <ul>
                    <li ><Link className='nav-Links' to="/">Home</Link></li>
                    <li ><Link className='nav-Links' to="/About">About</Link></li>
                    <li ><Link className='nav-Links' to="/Services">Services</Link></li>
                    <li ><Link className='nav-Links' to="#Projects">Projects</Link></li>
                    <li ><Link className='nav-Links' to="#Contact">Contact</Link></li>
                </ul>
            </div>
        </div>

    )
}
